import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import * as cal from './Heading.jsx';

function card(propz) {
  return ( 
  <div>
    <p>{propz.name}</p>
    <p>{propz.tel}</p>
    <p>{propz.email}</p>
  </div>
  );
}

ReactDOM.render(
  <div>
    {cal.default()}
    <card
      name = "wilson"
      tel = "012345"
      email = "hahahaha"
    />
  </div>,
  document.getElementById('roots')
);

